import './App.css';
import React, { useEffect, useState } from "react"
import NavBar from "./components/NavBar"

function App() {
    // Global variables
    const [ wallet, setWallet ] = useState(null)
    const [ data, setData ] = useState({})

    // Allows writing of parent data from child
    function onChange(input) {setData(input)}

    // On wallet update begin populating gallery
    useEffect(() => {
        console.log("Data changed: ")
        console.log(data)

        // Determine if JSON returned is asset or address
        if(data.length > 0) {
            console.log("Checking for values")
            data.forEach((asset) => {
                console.log(asset)
            })
        }

    }, [data])

    return (
        <NavBar 
            data={data} 
            onChange={onChange}
        />
    );
}

export default App;
